import React from "react";
import "../styles/Header.css";

// By importing the Header.css file, it is added to the DOM whenever this component loads
const style = {
  header: {
    backgroundColor: "red",
    marginBottom: "10px",
    height: "150px"
  }
};

function Header() {
  return (
    <header style={style.header} className="header">
      <h1>Welcome</h1>
    </header>
  );
}

export default Header;
